import React from "react";
import singer from "./singer.png";

const Registration = () => {
  return (
    <div >
      <div className="board">
        <img src={singer} alt="not found" />
      </div>
      <div className="form-Select">
        <form action="">
         <input type="text" />
         <input type="text" />
         <input type="email" name="" id="" />
         
          

        </form>
      </div>

    </div>
  );
};

export default Registration;
